import { useState } from "react";

function Homepage() {

    const [search, setSearch] = useState('');
    function changeSearch(e) {
        setSearch(e.target.value);
    }
    return (
        <div>
            <div className="footer">
                <div>
                    <div className="items"><input type="text" placeholder="Search" onChange={changeSearch}></input></div>
                    <div className="items">Welcome</div>
                </div>

            </div>
        </div>
    )
}

export default Homepage;
